    \"parent_fxf\" : [],\n            \"description\" : \"This dataset is a listing of all active City of Chicago employees, complete with full names, departments, positions, employment status (part-time or full-time), frequency of hourly employee –where applicable—and annual salaries or hourly rate. Please note that \\\"active\\\" has a specific meaning for Human Resources purposes and will sometimes exclude employees on certain types of temporary leave. For hourly employees, the City is providing the hourly rate and frequency of hourly employees (40, 35, 20 and 10) to allow dataset users to estimate annual wages for hourly employees. Please note that annual wages will vary by employee, depending on number of hours worked and seasonal status. For information on the positions and related salaries detailed in the annual budgets, see https://www.cityofchicago.org/city/en/depts/obm.html\\n\\nData Disclosure Exemptions:\\nInformation disclosed in this dataset is subject to FOIA Exemption Act, 5 ILCS 140/7 (Link:https://www.ilga.gov/legislation/ilcs/documents/000501400K7.htm)\",\n            \"attribution\" : \"City of Chicago\",\n            \"attribution_link\" : \"http://www.chicago.gov\",\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-07-16T04:50:00.000Z\",\n            \"createdAt\" : \"2011-09-27T20:18:55.000Z\",\n            \"metadata_updated_at\" : \"2024-06-18T19:22:48.000Z\",\n            \"data_updated_at\" : \"2025-07-16T04:50:00.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 2473,\n                \"page_views_last_month\" : 8600,\n                \"page_views_total\" : 2122560,\n                \"page_views_last_week_log\" : 11.27262978497637,\n                \"page_views_last_month_log\" : 13.070288689961679,\n                \"page_views_total_log\" : 21.01737458512035\n              },\n            \"columns_name\" :\n              [\n  