they work in a week. See the \\\"Frequency Description\\\" column.\",\n                \"Name of employee\",\n                \"Title of employee at the time when the data were updated.\",\n                \"Annual salary rates. Only applies for employees whose pay frequency is \\\"Salary\\\". Hourly employees rates are only shown in \\\"Hourly Rates\\\" column.\",\n                \"Department where employee worked.\",\n                \"Whether the employee was employed full- (F) or part-time (P).\"\n              ],\n            \"columns_format\" :\n              [\n                {\n                  \"precisionStyle\" : \"standard\",\n                  \"noCommas\" : \"true\",\n                  \"align\" : \"left\"\n                },\n                {\n                  \"precision\" : \"2\",\n                  \"align\" : \"right\",\n                  \"currencyStyle\" : \"USD\",\n                  \"humane\" : \"false\",\n                  \"precisionStyle\" : \"currency\"\n                },\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                {\n                  \"displayStyle\" : \"plain\",\n                  \"rdf\" : \"http://xmlns.com/foaf/0.1/name\",\n                  \"align\" : \"left\",\n                  \"aggregate\" : \"count\"\n                },\n                {\n                  \"displayStyle\" : \"plain\",\n                  \"rdf\" : \"http://xmlns.com/foaf/0.1/title\",\n                  \"align\" : \"left\"\n                },\n                {\n                  \"precision\" : \"2\",\n                  \"align\" : \"right\",\n                  \"aggregate\" : \"sum\",\n                  \"currencyStyle\" : \"USD\",\n                  \"humane\" : \"false\",\n                  \"precisionStyle\" : \"currency\"\n                },\n                {\n                  \"displayStyle\" : \"plain\",\n                  \"rdf\" : \"http://xmlns.com/foaf/0.1/workplaceHomepage\",\n                